import React from 'react';
import { styled } from 'styled-components';

const Container = styled.div`
  border: 1px solid red;
  width: 100%;
  height: 60vh;
  display: flex;
  justify-content: center;
`;

const Content = styled.div`
  border: 1px solid red;
`

const Login = () => {
  return (
    <Container>
      <Content>

      </Content>
    </Container>
  )
}

export default Login;
